        this.state = {
        }
        this.submitForm = this.submitForm.bind(this);
    }

    submitForm = async (e)=>{
        e.preventDefault();
        const name = await this.state.name.value;
        alert(name);
    }




    render(){
        return(
            <div className='ContactsPage'>
                <AddContact name={name=> this.state.formName = name} street={street=> this.state.formStreet = street} city={city=> this.state.formCity = city} email={email=> this.state.formEmail = email}  />
            </div>
        )
    }
}

export default index
